import TextField from '@mui/material/TextField';
import {Container, Paper} from "@mui/material";

export default function Person() {

    const paperStyle = {padding: '50px 20px', width: 600, margin: '20px auto'}

    return (<Container>
            <Paper elevation={3} style={paperStyle}>

                <h1 style={{color:"blue", unde}}>
                    <u>Add a person</u>
                </h1>
                <Box
                    component="form"
                    sx={{
                        '& > :not(style)': {m: 1, width: '25ch'},
                    }}
                    noValidate
                    autoComplete="off"
                >
                    <TextField id="standard-basic" label="Имя и Фамилия" variant="standard" fullWidth/>
                    <TextField id="standard-basic" label="С кем вы будете?" variant="standard" fullWidth/>
                </Box>
            </Paper>
        </Container>);
}
